import React, { Component } from "react";
import "./About.css";
import picture from "../../img/pfp2.jpg";

class About extends Component {
    constructor(props) {
      super(props);

    }

    render() {
      return (
        <div className='About-container'>
            <div><img src={picture} className='About-pfp' /></div>
            <div className='bio-container u-bordering'>
                <p className='bio-text'>
                    Hi! My name is Adam Janicki, and I'm a sophomore at MIT studying Computer Science and Engineering (Course 6-3) with a minor in Math.
                    <br></br><br></br>Recently, I've been working as an Undergraduate Research Assistant at the MIT Civic Data Design Lab, as well as a Lab Assistant for Intro to Computer Science under the MIT Department of EECS.
                     <br></br><br></br>Outside of Academics, I'm a member of the MIT Varsity Swimming and Diving Team, and also a mentor for Amphibious Achievement. I'm a total geek for movies and love writing about what I watch.
                     <br></br><br></br>Thanks for stopping by; I'd love to connect! Feel free to reach out to me by email!
                </p>
            </div>
        </div>
      );
    }
  }

  export default About;
